webpackJsonp(10,{45:function(a,b,c){a.exports="<h1>Hash in URL</h1><p>This component handles updates to and change events from the url hash. It also handles clicks on link to other steps. As the initial hash also defines a starting step which should override the Starting Step component, this component should be included after that.</p><h3><code>property</code> hash.use : <code>true</code></h3><p>Whether the url hash should be used with jmpress.</p><h3><code>property</code> hash.update : <code>true</code></h3><p>Whether the url hash should be updated on step change.</p><h3><code>property</code> hash.bindChange : <code>true</code></h3><p>Whether changes of the url hash and clicks on link should be converted into step selects.</p>"}})